INSERT INTO `t_peticiones` (`id`, `user_id`, `tipo_id`, `asunto`, `notas`, `fecha_creacion`, `estado`, `fecha_procesada`, `user_id_procesa`, `notas_respuesta`) VALUES
(97, 38, 5, 'Error al importar archivo', 'He intentado actualizar los datos de mis afiliados y mi aparece el siguiente error:\n"Error interno en modificación"\n¿A qué es debido?\nUn saludo', '2012-10-04 12:36:58', 'C', NULL, NULL, 'Se ha solventado el problema'),
(98, 38, 1, 'Consulta por Centros', 'Sería conveniente que en cada provincia puediesemos ver que afiliados de otras provincias trabajan en nuestra provincia.\nSi se crea una consulta en el que se pida los dos primeros dígitos del centro,(ej. 21 para los de Huelva), podriamos saber a la hora de las visitas quienes son afiliados de X, aunque no lo sean de nuestra provinica.', '2012-10-04 12:39:28', 'D', NULL, NULL, 'No es posible. Hay intromisión de información muy sensible.\n \nDicha información se haría por acuerdo de Comité Ejecutivo Nacional, que fallo en contrario. Solo se aceptó la consulta Nacional por DNI, Nombre y provincia de afiliación.'),
(107, 38, 6, 'Consulta por centros', 'No comprendo el problema. Como XY provincial puedo ver "información sensible" de cualquier afiliado nacional. Por ejemplo si busco el nombre Juan me aparecen todos los afiliados con ese nombre y puedo incluso hacer modificaciones, algo que si que habría que evitar.', '2012-10-05 11:27:06', 'C', NULL, NULL, 'Actualmente no tiene permisos para consultar o modificar afiliados que no sean de su provincia'),
