(177, 43, 3, 'Cambio dirección afiliados', 'Buenos días,\n\nTengo un problema cuando quiero cambiar la dirección de un/a afiliado/a puesto que, al modificar la dirección me solicita el núm. de cuenta corriente y la categoría. No hay ninguna opción para poder cambiar datos sin la necesidad de introducir núm. corriente y categoría. \n\nLas siguientes afiliadas han cambiado de dirección:\n\nELVIRA MASIA ESPIN\nC/ Berguedà, 134\n08207 SABADELL\n\nANTONIETA MERINO DE LOS SANTOS\nPasseig 11 de Setembre, 73   4º  4º\n25199 LLEIDA\n\nGracias,\nX LLEIDA', '2013-03-14 10:33:54', 'C', NULL, NULL, 'Si desea que no se se le solicite la cuenta corriente de un afiliado. Desactive la opción "Obligar a introducir cuenta corriente al crear o modificar afiliado" que tiene disponible en la opciones de usuario.'),
