(182, 38, 5, 'LISTADO DE EMAIL DUPLICADOS', 'cuando solicito un listado de email aparecen muchos de ellos repetidos hasta ocho veces.\n¿cómo puedo resolver ese problema?', '2013-10-25 09:10:23', 'C', NULL, NULL, 'Se ha resuelto su problema. Ahora tan solo se muestra un valor diferente independiente del número de repeticiones del campo que se tenga.'),
(185, 61, 5, 'generar carnet afiliados', 'Solicito se revise el sistema porque no se puede generar el carnet de los afiliados. Nos han avisado de que no les aparece la imagen del carnet.', '2013-10-31 11:04:47', 'C', NULL, NULL, 'Ya se ha resuelto la incidencia. Ahora funciona correctamente'),
