(197, 38, 6, 'No me reconoce el fichero', 'Estoy intentando importar los datos de los organos de gobierno provinciales. Desde importar selecciono importacion modificaciones campos, y selecciono el fichero a importar. Me da el siguiente error: version incorrecta del fichero de importacion', '2014-02-07 11:35:16', 'C', NULL, NULL, 'Según se indica en la opción de importación en el apartado de preguntas frecuentes:\n\n¿Por qué se produce el error "Versión incorrecta del fichero de importación"?\n\nDebido a que la estructura del fichero de importación puede cambiar con el tiempo, se ha incluido un identificador que indica la versión que actualmente se está utilizando. Si descarga el fichero que tiene disponible en la web siempre tendrá la última versión. En cambio si utiliza un fichero que ha guardado previamente puede que se hayan realizado modificaciones posteriores y la versión que usted utiliza no coincida con la utilizada actualmente.\n\nUtilice el enlace que existe en la página de importación para descargar la plantilla');
